#include <bits/stdc++.h>
const char *ans = "";
int t, d, n;
int main() {
	assert(scanf("%d", &t) == 1 && 1 <= t && t <= 900);
	for(int Case = 1; Case <= t; ++Case) {
		assert(scanf("%d%d", &d, &n) == 2 && 1 <= d && d <= 9 && 1 <= n && n <= 100);
		printf("Case #%d: %c\n", Case, ans[(n - 1) * 9 + (d - 1)]);
	}
	return 0;
}
